import logo from './logo.svg';
import './App.css';

function App() {
  <nav class="navbar navbar-light bg-black">
    <div class="container-fluid" style="flex-wrap: nowrap;">
      <a href="" class="navbar-brand" style="color:white;"><img src="img/d1f9b8f527b7e173355bef4c248cdc94.png"
        alt="" width="160" height="90" /></a>
      <form class="d-flex">
        <input class="form-control me-1" type="search" placeholder="Поиск..." aria-label="Search" />
        <button class="btn btn-outline-light" type="reset">все</button>
      </form>
    </div>
  </nav>
}

export default App;
